import React, { Component } from 'react'
import { connect } from 'react-redux'
import { Segment, Container, Header } from "semantic-ui-react";
import { OrderDetailsSellerDecision } from "./OrderDetailsSellerDecision";

 class AuctionWithMinPrice extends Component {
    render() {
        return (
          <Container>
            <Segment>
              <Header as='h1'>Resell Item(s) on Platform as Auction with Min Price</Header>
              <OrderDetailsSellerDecision urlOrderId={this.props.match.params.id} sellerDecision={"AuctionWithMinPrice"} />
            </Segment>
          </Container>
        );
      }
}

const mapState = (state) => ({});

const actionCreators = {};

const connectedAuctionWithMinPrice = connect(mapState, actionCreators)(AuctionWithMinPrice);

export { connectedAuctionWithMinPrice as AuctionWithMinPrice };
